品牌简介
Melissa & Doug是来自美国的知名品牌，于1997年创立，总部位于康奈迪克州（Connecticut）。该品牌号称无毒的涂料和原材料，超过美国所有的标准，颇受妈妈们的青睐。创办人Melissa和Doug Bernstein从聆听每个父母的需求中，以高标准的安全性和耐玩性为制作基础，更提高玩具价值，针对不同年龄儿童成长必须培养的各项能力，如感官发展，学习力，表达力来设计不同类型的玩具和游戏，丰富教育性，藉此引导儿童成长。Melissa & Doug是儿童起智玩具设计和制造界的领导者。


